sys_variable_value.value:
(function execute(inputs, outputs) {
  inputs = new sn_fb_wp_spoke.FacebookWorkplaceUtils().trimStringInputs(inputs);

  if (inputs.status_code == '200') {
    outputs.status = "Success";
    var flag = 0;
    var response = JSON.parse(inputs.response);
    for (var i = 0; i < response.data.length; i++) {
      if (response.data[i].name === inputs.group_name) {
        outputs.group_id = response.data[i].id
        flag = 1;
        return;
       }
    }
      if (flag == 0)
      {
	  inputs.response = 'GROUP_NAME_NOT_FOUND';
      outputs = new sn_fb_wp_spoke.FacebookWorkplaceErrorHandler().groupErrorHandler(inputs, outputs);
	  }

  } else
    outputs = new sn_fb_wp_spoke.FacebookWorkplaceErrorHandler().groupErrorHandler(inputs, outputs);  
})(inputs, outputs);

